import "./navbar.css";

function Navbar() {
  return <>
  <nav className="nav-bar">
    <h1>RiVVE</h1>
    <ul>
      <li><a href="">Home</a></li>
      <li><a href="">About</a></li>
      <li><a href="">Hostels</a></li>
      <li><a href="">Contact</a></li>
    </ul>

  </nav>
  </>;
}

export default Navbar;
